Kymberly is an accomplished model and actress as well as a really fun person. Full of personality, she has a way of making everything seem fun. Even moving many suitcases of clothing and makeup. But that's OK. Kym's doing exactly what she wants, and making a good life for herself fooling around with movie stars in exotic far away places, beating (sometimes) the tables in Monaco, carving the Winter slopes in Sun Valley, or hiding away on her Santa Fe Ranch.
